"use strict";(self.webpackChunkwaste_of_space_wiki=self.webpackChunkwaste_of_space_wiki||[]).push([[9197],{14103:e=>{e.exports=JSON.parse('{"tag":{"label":"Spawnable","permalink":"/Pilot.lua-Luau-LSP/tags/spawnable","allTagsPath":"/Pilot.lua-Luau-LSP/tags","count":295,"items":[{"id":"objects/100k","title":"100k","description":"100k visits special item.","permalink":"/Pilot.lua-Luau-LSP/objects/100k"},{"id":"objects/Aerogel","title":"Aerogel","description":"An incredibly light and fragile material.","permalink":"/Pilot.lua-Luau-LSP/objects/Aerogel"},{"id":"objects/AirSupply","title":"AirSupply","description":"Generates a 300 stud radius oxygen bubble when powered on. Very important part for space ships, as it acts as the oxygen supply for the ship.","permalink":"/Pilot.lua-Luau-LSP/objects/AirSupply"},{"id":"objects/AlienCore","title":"AlienCore","description":"A mysterious piece of technology found within many robotic aliens.","permalink":"/Pilot.lua-Luau-LSP/objects/AlienCore"},{"id":"objects/Aluminum","title":"Aluminum","description":"A light, non-durable material. Has a good thermal conductivity, but is lower than most other metals.","permalink":"/Pilot.lua-Luau-LSP/objects/Aluminum"},{"id":"objects/Anchor","title":"Anchor","description":"When triggered or clicked, it is able to be anchored, a state in which it is immovable by physics, and applies to parts connected to it.","permalink":"/Pilot.lua-Luau-LSP/objects/Anchor"},{"id":"objects/Antenna","title":"Antenna","description":"A wireless transmitter that can transmit electricity from wires and trigger signals from trigger wires and buttons.","permalink":"/Pilot.lua-Luau-LSP/objects/Antenna"},{"id":"objects/Apparel","title":"Apparel","description":"A piece of clothing that can be worn by other players. Parts can also be attached to the apparel, meaning you can create your own suits with the apprel.","permalink":"/Pilot.lua-Luau-LSP/objects/Apparel"},{"id":"objects/ARController","title":"ARController","description":"Like a TouchScreen, but for your actual screen.","permalink":"/Pilot.lua-Luau-LSP/objects/ARController"},{"id":"objects/ARGlasses","title":"ARGlasses","description":"Like a handheld Microcontroller, with a TouchScreen for your actual screen.","permalink":"/Pilot.lua-Luau-LSP/objects/ARGlasses"},{"id":"objects/Artillery","title":"Artillery","description":"Fires a fast-moving metal shell upon being triggered.","permalink":"/Pilot.lua-Luau-LSP/objects/Artillery"},{"id":"objects/Asphalt","title":"Asphalt","description":"A modern material useful for smooth road surfaces.","permalink":"/Pilot.lua-Luau-LSP/objects/Asphalt"},{"id":"objects/Assembler","title":"Assembler","description":"Assembles items as configured when the structure is supplied with the required power and resources.","permalink":"/Pilot.lua-Luau-LSP/objects/Assembler"},{"id":"objects/AutomaticLaser","title":"AutomaticLaser","description":"Fires a continous set of lasers when powered. Like most other energy/thermal weapons, it generates heat when powered. It generates up to 65 degrees of heat, meaning you will need atleast 2 or 3 coolers.","permalink":"/Pilot.lua-Luau-LSP/objects/AutomaticLaser"},{"id":"objects/Ball","title":"Ball","description":"A ball shaped template object.","permalink":"/Pilot.lua-Luau-LSP/objects/Ball"},{"id":"objects/BallastTank","title":"BallastTank","description":"Allows for variable ballast to be added to sea vehicles. Also prevents corrosion to attached parts underwater.","permalink":"/Pilot.lua-Luau-LSP/objects/BallastTank"},{"id":"objects/Balloon","title":"Balloon","description":"Levitates parts attached to it to a certain configurable height.","permalink":"/Pilot.lua-Luau-LSP/objects/Balloon"},{"id":"objects/Battery","title":"Battery","description":"A light part that contains 400 energy and is prefilled. Cannot be recharged.","permalink":"/Pilot.lua-Luau-LSP/objects/Battery"},{"id":"objects/Beacon","title":"Beacon","description":"Creates a small beacon of light when powered.","permalink":"/Pilot.lua-Luau-LSP/objects/Beacon"},{"id":"objects/Beaker","title":"Beaker","description":"A container for holding mixed chemicals.","permalink":"/Pilot.lua-Luau-LSP/objects/Beaker"},{"id":"objects/BeamRifle","title":"BeamRifle","description":"A deadly long-range energy sniper. Able to pick off targets at a long range with exceptional accuracy.","permalink":"/Pilot.lua-Luau-LSP/objects/BeamRifle"},{"id":"objects/Beryllium","title":"Beryllium","description":"A lightweight metal only found on Barren planets used for preventing plutonium cores from going supercritical until detonated.","permalink":"/Pilot.lua-Luau-LSP/objects/Beryllium"},{"id":"objects/Billboardium","title":"Billboardium","description":"A super strong alloy made of Robux and pure refined ad.","permalink":"/Pilot.lua-Luau-LSP/objects/Billboardium"},{"id":"objects/Bin","title":"Bin","description":"Stores solid items such as Aluminum, Iron, Faucets, etc.","permalink":"/Pilot.lua-Luau-LSP/objects/Bin"},{"id":"objects/BlackBox","title":"BlackBox","description":"Records all activity in the region using very delicate instruments.","permalink":"/Pilot.lua-Luau-LSP/objects/BlackBox"},{"id":"objects/Blade","title":"Blade","description":"A legacy pre-component part. A sharp object that can pierce through objects if the material is durable and strong.","permalink":"/Pilot.lua-Luau-LSP/objects/Blade"},{"id":"objects/BlastingCap","title":"BlastingCap","description":"A component used in crafting recipes for more advanced explosive devices.","permalink":"/Pilot.lua-Luau-LSP/objects/BlastingCap"},{"id":"objects/Block","title":"Block","description":"A block shaped template object.","permalink":"/Pilot.lua-Luau-LSP/objects/Block"},{"id":"objects/Boiler","title":"Boiler","description":"Consumes Coal and Water and produces Steam.","permalink":"/Pilot.lua-Luau-LSP/objects/Boiler"},{"id":"objects/Boombox","title":"Boombox","description":"Must be powered in order to play music. When clicked, it will toggle playing music and will play the song id you give it.","permalink":"/Pilot.lua-Luau-LSP/objects/Boombox"},{"id":"objects/Brick","title":"Brick","description":"A cheap, malleable material with special durability properties. The durability is 4, and becomes 18 when it is anchored or attached to terrain (grounded).","permalink":"/Pilot.lua-Luau-LSP/objects/Brick"},{"id":"objects/BurnerGenerator","title":"BurnerGenerator","description":"Creates electricity when fueled with coal.","permalink":"/Pilot.lua-Luau-LSP/objects/BurnerGenerator"},{"id":"objects/BurstLaser","title":"BurstLaser","description":"Fires 5 rapid sets of concentrated laser beams. Each beam does a mediate amount of damage.","permalink":"/Pilot.lua-Luau-LSP/objects/BurstLaser"},{"id":"objects/Button","title":"Button","description":"Sends trigger signals when clicked by a player.","permalink":"/Pilot.lua-Luau-LSP/objects/Button"},{"id":"objects/Camera","title":"Camera","description":"It\'s a camera.","permalink":"/Pilot.lua-Luau-LSP/objects/Camera"},{"id":"objects/Cannon","title":"Cannon","description":"Fires a cannon ball when triggered or clicked.","permalink":"/Pilot.lua-Luau-LSP/objects/Cannon"},{"id":"objects/Cement","title":"Cement","description":"A modern material useful for pavement.","permalink":"/Pilot.lua-Luau-LSP/objects/Cement"},{"id":"objects/ChemicalSynthiser","title":"ChemicalSynthiser","description":"Synthesizes and mixes chemical compounds. Consumes matter out of attached bins in order to fuel the material synthesis.","permalink":"/Pilot.lua-Luau-LSP/objects/ChemicalSynthiser"},{"id":"objects/Chute","title":"Chute","description":"Used to transfer solid resources between objects such as bins and extractors.","permalink":"/Pilot.lua-Luau-LSP/objects/Chute"},{"id":"objects/Claymore","title":"Claymore","description":"A classic medieval sword used to cut down your enemies.","permalink":"/Pilot.lua-Luau-LSP/objects/Claymore"},{"id":"objects/Cleat","title":"Cleat","description":"A textile resource similar to Rubber, except it has a high amount of friction and low bounciness. It can be used in physical machines such as the feet of mechs.","permalink":"/Pilot.lua-Luau-LSP/objects/Cleat"},{"id":"objects/CloningBay","title":"CloningBay","description":"Allows you to respawn at it from a remote location.","permalink":"/Pilot.lua-Luau-LSP/objects/CloningBay"},{"id":"objects/Cloth","title":"Cloth","description":"A soft thin fabric that can soak up liquids.","permalink":"/Pilot.lua-Luau-LSP/objects/Cloth"},{"id":"objects/Coal","title":"Coal","description":"A natural resources commonly used as a source of generating heat and energy. Can be placed in a BurnerGenerator to generate simple and fast energy.","permalink":"/Pilot.lua-Luau-LSP/objects/Coal"},{"id":"objects/CombustionTurbine","title":"CombustionTurbine","description":"Creates electricity when fueled by gasoline.","permalink":"/Pilot.lua-Luau-LSP/objects/CombustionTurbine"},{"id":"objects/Cone","title":"Cone","description":"A cone shaped template object.","permalink":"/Pilot.lua-Luau-LSP/objects/Cone"},{"id":"objects/Constructor","title":"Constructor","description":"Similar to an assembler, but constructs a model when triggered. However, the Constructor must be supplied with the correct materials for a model.","permalink":"/Pilot.lua-Luau-LSP/objects/Constructor"},{"id":"objects/Controller","title":"Controller","description":"Alters the speed of attached controllable objects which include:","permalink":"/Pilot.lua-Luau-LSP/objects/Controller"},{"id":"objects/ConveyorBelt","title":"ConveyorBelt","description":"Moves objects ontop of it towards the front of the conveyor belt. Only moves when powered and anchored or attached to the ground.","permalink":"/Pilot.lua-Luau-LSP/objects/ConveyorBelt"},{"id":"objects/Cooler","title":"Cooler","description":"Cools down the heat around a space when supplied with power.","permalink":"/Pilot.lua-Luau-LSP/objects/Cooler"},{"id":"objects/Copper","title":"Copper","description":"A brown, shiny metal used heavily in electronics, a great conductor of both heat and electricity. Has a very high thermal conductivity, easily the best for common metals.","permalink":"/Pilot.lua-Luau-LSP/objects/Copper"},{"id":"objects/CornerRoundWedge","title":"CornerRoundWedge","description":"A rounded corner shaped template object.","permalink":"/Pilot.lua-Luau-LSP/objects/CornerRoundWedge"},{"id":"objects/CornerRoundWedge2","title":"CornerRoundWedge2","description":"A corner shaped template object rounded inwards.","permalink":"/Pilot.lua-Luau-LSP/objects/CornerRoundWedge2"},{"id":"objects/CornerTetra","title":"CornerTetra","description":"A template which is a tetrahedron subtracted from a cube.","permalink":"/Pilot.lua-Luau-LSP/objects/CornerTetra"},{"id":"objects/CornerWedge","title":"CornerWedge","description":"A corner wedge shaped template object.","permalink":"/Pilot.lua-Luau-LSP/objects/CornerWedge"},{"id":"objects/Coupler","title":"Coupler","description":"Will connect to nearby couplers with matching CouplerIDs when activated by Polysilicon. Deactivating via Polysilicon will detach two couplers. Repeatedly emits trigger signals when it is able to connect with another coupler of the same ID.","permalink":"/Pilot.lua-Luau-LSP/objects/Coupler"},{"id":"objects/CrossBow","title":"CrossBow","description":"A cheap primitive ranged weapon.","permalink":"/Pilot.lua-Luau-LSP/objects/CrossBow"},{"id":"objects/CrudeWing","title":"CrudeWing","description":"Creates lift from being pushed forward.","permalink":"/Pilot.lua-Luau-LSP/objects/CrudeWing"},{"id":"objects/Cylinder","title":"Cylinder","description":"A cylinder shaped template object.","permalink":"/Pilot.lua-Luau-LSP/objects/Cylinder"},{"id":"objects/DarkConverter","title":"DarkConverter","description":"Converts attached dark matter bins into energy. 1 unit of dark matter is equal to 1000 watts of power. However, this generates a ton of heat in the process, nearly up to 200 degrees when activated. This means you will need about 10 coolers to avoid combustion.","permalink":"/Pilot.lua-Luau-LSP/objects/DarkConverter"},{"id":"objects/DarkMatter","title":"DarkMatter","description":"A very valuable material extracted from black holes and a few empty regions in space. Can be used to generate energy when supplied to a DarkConverter.","permalink":"/Pilot.lua-Luau-LSP/objects/DarkMatter"},{"id":"objects/DarkReactor","title":"DarkReactor","description":"Generates Dark Matter when powered and near a black hole.","permalink":"/Pilot.lua-Luau-LSP/objects/DarkReactor"},{"id":"objects/Decoupler","title":"Decoupler","description":"When triggered, it breaks welds and falls off of anything attached.","permalink":"/Pilot.lua-Luau-LSP/objects/Decoupler"},{"id":"objects/DelayWire","title":"DelayWire","description":"Similar to a regular trigger wire, but depending on the configuration will wait x seconds before the trigger signal passes through.","permalink":"/Pilot.lua-Luau-LSP/objects/DelayWire"},{"id":"objects/DeleteSwitch","title":"DeleteSwitch","description":"An object that deletes itself when triggered.","permalink":"/Pilot.lua-Luau-LSP/objects/DeleteSwitch"},{"id":"objects/DevBattery","title":"DevBattery","description":"A debug item meant for developers.","permalink":"/Pilot.lua-Luau-LSP/objects/DevBattery"},{"id":"objects/DevGenerator","title":"DevGenerator","description":"A debug item meant for developers.","permalink":"/Pilot.lua-Luau-LSP/objects/DevGenerator"},{"id":"objects/DevHeatStorage","title":"DevHeatStorage","description":"A debug item meant for developers.","permalink":"/Pilot.lua-Luau-LSP/objects/DevHeatStorage"},{"id":"objects/DevSink","title":"DevSink","description":"A debug item meant for developers.","permalink":"/Pilot.lua-Luau-LSP/objects/DevSink"},{"id":"objects/DevSource","title":"DevSource","description":"A debug item meant for developers.","permalink":"/Pilot.lua-Luau-LSP/objects/DevSource"},{"id":"objects/Diamond","title":"Diamond","description":"A rare, carbon-dense, and very durable gem. Takes 2x energy damage & allows lasers to pass.","permalink":"/Pilot.lua-Luau-LSP/objects/Diamond"},{"id":"objects/Diode","title":"Diode","description":"Acts as a wire/chute/pipe/etc, but only works one way, through the diode\'s input and output faces as indicated by the arrow.","permalink":"/Pilot.lua-Luau-LSP/objects/Diode"},{"id":"objects/Disk","title":"Disk","description":"A programmable object capable of storing complex data.","permalink":"/Pilot.lua-Luau-LSP/objects/Disk"},{"id":"objects/Dispenser","title":"Dispenser","description":"Releases items from attached bins.","permalink":"/Pilot.lua-Luau-LSP/objects/Dispenser"},{"id":"objects/Door","title":"Door","description":"A legacy pre-component part. When triggered, it will open, and if triggered again will close.","permalink":"/Pilot.lua-Luau-LSP/objects/Door"},{"id":"objects/DriveBox","title":"DriveBox","description":"When connected to a motor or engine with a rod, it will spin the same speed the engine or motor is going.","permalink":"/Pilot.lua-Luau-LSP/objects/DriveBox"},{"id":"objects/Egg","title":"Egg","description":"The perfect consumable item.","permalink":"/Pilot.lua-Luau-LSP/objects/Egg"},{"id":"objects/ElectricFence","title":"ElectricFence","description":"A special version of the fence which damages upon contact as long as it is powered. Conducts electricity like a wire.","permalink":"/Pilot.lua-Luau-LSP/objects/ElectricFence"},{"id":"objects/Electromagnet","title":"Electromagnet","description":"A powerful magnet.","permalink":"/Pilot.lua-Luau-LSP/objects/Electromagnet"},{"id":"objects/EnergyBomb","title":"EnergyBomb","description":"Causes a powerful explosion when triggered. Often used in space combat as a means of a powerful missile or torpedo.","permalink":"/Pilot.lua-Luau-LSP/objects/EnergyBomb"},{"id":"objects/EnergyGun","title":"EnergyGun","description":"Fires a powerful shot of energy when provided power and triggered.","permalink":"/Pilot.lua-Luau-LSP/objects/EnergyGun"},{"id":"objects/EnergyShield","title":"EnergyShield","description":"Generates a forcefield protecting its interior from energy-based weapons such as Lasers and PlasmaCannons, and offers full protection from Warhead explosions.","permalink":"/Pilot.lua-Luau-LSP/objects/EnergyShield"},{"id":"objects/EnergySword","title":"EnergySword","description":"A short ranged melee weapon which forms its own gravitational field when lunged. Forged with incarnated \u0336m\u0336a\u0336g\u0336i\u0336c science!","permalink":"/Pilot.lua-Luau-LSP/objects/EnergySword"},{"id":"objects/Engine","title":"Engine","description":"It acts similar to a motor, but is powered by gasoline instead of electricity.","permalink":"/Pilot.lua-Luau-LSP/objects/Engine"},{"id":"objects/EthernetCable","title":"EthernetCable","description":"Allows for the transfer of data between ports. Mostly utilized in programming.","permalink":"/Pilot.lua-Luau-LSP/objects/EthernetCable"},{"id":"objects/ExoticMatter","title":"ExoticMatter","description":"???","permalink":"/Pilot.lua-Luau-LSP/objects/ExoticMatter"},{"id":"objects/Explosive","title":"Explosive","description":"Causes an explosion when triggered. You can use a delay wire to make it explode after a few seconds and not immediately.","permalink":"/Pilot.lua-Luau-LSP/objects/Explosive"},{"id":"objects/Extinguisher","title":"Extinguisher","description":"A handy container with a spray nozzle to extinguish fires.","permalink":"/Pilot.lua-Luau-LSP/objects/Extinguisher"},{"id":"objects/Extractor","title":"Extractor","description":"Harvests or mines materials from the world. It can extract things like grass, snow, wood, ores, etc depending on what terrain it is attached to.","permalink":"/Pilot.lua-Luau-LSP/objects/Extractor"},{"id":"objects/FactionSpawn","title":"FactionSpawn","description":"Acts as a spawn location for the faction of the player who locked it.","permalink":"/Pilot.lua-Luau-LSP/objects/FactionSpawn"},{"id":"objects/Faucet","title":"Faucet","description":"Releases liquids and gases from Tanks.","permalink":"/Pilot.lua-Luau-LSP/objects/Faucet"},{"id":"objects/Fence","title":"Fence","description":"A metal fence. Can be used to set up walls and guard structures and bases.","permalink":"/Pilot.lua-Luau-LSP/objects/Fence"},{"id":"objects/Filter","title":"Filter","description":"Similar to a chute and a pipe, but only allows the configured material to pass through.","permalink":"/Pilot.lua-Luau-LSP/objects/Filter"},{"id":"objects/FireWood","title":"FireWood","description":"A version of wood that is able to burn longer, allowing it to be an efficient fire burning device.","permalink":"/Pilot.lua-Luau-LSP/objects/FireWood"},{"id":"objects/Fireworks","title":"Fireworks","description":"Causes an explosion when triggered. You can use a delay wire to make it explode after a few seconds and not immediately.","permalink":"/Pilot.lua-Luau-LSP/objects/Fireworks"},{"id":"objects/Flamethrower","title":"Flamethrower","description":"Shoots a stream of flaming gasoline to ignite your foes.","permalink":"/Pilot.lua-Luau-LSP/objects/Flamethrower"},{"id":"objects/Flashlight","title":"Flashlight","description":"A flashlight which can be used to provide light.","permalink":"/Pilot.lua-Luau-LSP/objects/Flashlight"},{"id":"objects/Flint","title":"Flint","description":"Useful for lighting up flammable materials.","permalink":"/Pilot.lua-Luau-LSP/objects/Flint"},{"id":"objects/FloatDevice","title":"FloatDevice","description":"Produces a force which counteracts gravity and keeps the device floating. The device will additionally resist upwards and downwards vertical motion.","permalink":"/Pilot.lua-Luau-LSP/objects/FloatDevice"},{"id":"objects/FluidProjector","title":"FluidProjector","description":"A device which projects a field of gas or liquid in front of it which you can swim in.","permalink":"/Pilot.lua-Luau-LSP/objects/FluidProjector"},{"id":"objects/Food","title":"Food","description":"A consumable item.","permalink":"/Pilot.lua-Luau-LSP/objects/Food"},{"id":"objects/FourthOfJuly","title":"FourthOfJuly","description":"Causes an explosion when triggered along with a Fourth Of July message. You can use a delay wire to make it explode after a few seconds and not immediately.","permalink":"/Pilot.lua-Luau-LSP/objects/FourthOfJuly"},{"id":"objects/Framewire","title":"Framewire","description":"Enter the matrix.","permalink":"/Pilot.lua-Luau-LSP/objects/Framewire"},{"id":"objects/Freezer","title":"Freezer","description":"Turns liquid Water into solid Ice, expelling heat energy in the process. Requires some power.","permalink":"/Pilot.lua-Luau-LSP/objects/Freezer"},{"id":"objects/Furnace","title":"Furnace","description":"Burns resources at 16x speed to produce Heat energy directly. Has a low thermal conductivity.","permalink":"/Pilot.lua-Luau-LSP/objects/Furnace"},{"id":"objects/Gasoline","title":"Gasoline","description":"A liquid used for fueling many devices such as rockets and engines.","permalink":"/Pilot.lua-Luau-LSP/objects/Gasoline"},{"id":"objects/Gear","title":"Gear","description":"A mechanical component commonly used in crafting recipes for many objects.","permalink":"/Pilot.lua-Luau-LSP/objects/Gear"},{"id":"objects/GeigerCounter","title":"GeigerCounter","description":"It is a craftable and spawnable non-flammable solid.","permalink":"/Pilot.lua-Luau-LSP/objects/GeigerCounter"},{"id":"objects/Generator","title":"Generator","description":"Creates energy from rotation.","permalink":"/Pilot.lua-Luau-LSP/objects/Generator"},{"id":"objects/Glass","title":"Glass","description":"Created when sand is burned, set on fire, or fed into a Kiln. Can be broken by heavy impacts or by fist.","permalink":"/Pilot.lua-Luau-LSP/objects/Glass"},{"id":"objects/Gold","title":"Gold","description":"A very valuable and stretchable material. Has a thermal conductivity less than copper, and higher than aluminum.","permalink":"/Pilot.lua-Luau-LSP/objects/Gold"},{"id":"objects/Goo","title":"Goo","description":"A sticky substance that binds things together like glue. The effect lasts for for two minutes, but it can be washed off with Water. It will also melt off at 95 \xb0F.","permalink":"/Pilot.lua-Luau-LSP/objects/Goo"},{"id":"objects/Grass","title":"Grass","description":"An organic substance found in terra and forest planets. Often green, but can be other colors. Useful for planting seeds for agriculture.","permalink":"/Pilot.lua-Luau-LSP/objects/Grass"},{"id":"objects/GravityGenerator","title":"GravityGenerator","description":"Generates an artificial gravity field when powered on. The gravity field only affects players, not individual parts. The amount of gravity can also be configureed, but the more gravity the higher amount of power needed. Only works in space, not inside planets.","permalink":"/Pilot.lua-Luau-LSP/objects/GravityGenerator"},{"id":"objects/Gun","title":"Gun","description":"Fires a harmful bullet when triggered.","permalink":"/Pilot.lua-Luau-LSP/objects/Gun"},{"id":"objects/Gyro","title":"Gyro","description":"Stabilizes vehicles and structures by pointing upwards. Useful for mechs or orientating structures to the correct rotation. Has a maximum range of 75000 studss. The gyro can also be configured to seek objects and players.","permalink":"/Pilot.lua-Luau-LSP/objects/Gyro"},{"id":"objects/HalfSphere","title":"HalfSphere","description":"A half sphere shaped template object.","permalink":"/Pilot.lua-Luau-LSP/objects/HalfSphere"},{"id":"objects/Handle","title":"Handle","description":"A handle which can be equipped when a player touches it, turning all connected parts into an equipable tool.","permalink":"/Pilot.lua-Luau-LSP/objects/Handle"},{"id":"objects/Hatch","title":"Hatch","description":"Acts as a chute when active/gray, but when black or inactive it acts as a normal object.","permalink":"/Pilot.lua-Luau-LSP/objects/Hatch"},{"id":"objects/HeatCell","title":"HeatCell","description":"Legacy test item. Stores heat energy.","permalink":"/Pilot.lua-Luau-LSP/objects/HeatCell"},{"id":"objects/Heater","title":"Heater","description":"Heats the air to 60 + volume / 16 * 10\xb0F.","permalink":"/Pilot.lua-Luau-LSP/objects/Heater"},{"id":"objects/HeatPipe","title":"HeatPipe","description":"Allows for the transfer of heat. Use a HeatPump to direct the heat.","permalink":"/Pilot.lua-Luau-LSP/objects/HeatPipe"},{"id":"objects/HeatPump","title":"HeatPump","description":"Pumps Heat between two points. Pumps a maximum of 4 MW of heat energy.","permalink":"/Pilot.lua-Luau-LSP/objects/HeatPump"},{"id":"objects/Heatshield","title":"Heatshield","description":"Generates a 300 stud radius area that protects all players and only players within the vicinity from temperature damage.","permalink":"/Pilot.lua-Luau-LSP/objects/Heatshield"},{"id":"objects/HeatSink","title":"HeatSink","description":"LEGACY. Reduces the air temperature by 10 \xb0F (Produces 13.018197023481843 kW of heat energy).","permalink":"/Pilot.lua-Luau-LSP/objects/HeatSink"},{"id":"objects/HeatValve","title":"HeatValve","description":"Acts as a HeatPipe when active/red, but when black or inactive it acts as a normal object.","permalink":"/Pilot.lua-Luau-LSP/objects/HeatValve"},{"id":"objects/Helium","title":"Helium","description":"A light invisible odorless gas, floats up.","permalink":"/Pilot.lua-Luau-LSP/objects/Helium"},{"id":"objects/Hologram","title":"Hologram","description":"Using our brand new Multi-Dimensional Holographic Projection Technology\u2122 you are able to create a stationary clone with only the ID of the user provided!.","permalink":"/Pilot.lua-Luau-LSP/objects/Hologram"},{"id":"objects/Hotdog","title":"Hotdog","description":"sandwich.","permalink":"/Pilot.lua-Luau-LSP/objects/Hotdog"},{"id":"objects/Hull","title":"Hull","description":"A legacy pre-component part. Is able to float in the water, as well as carry objects attached to it. Primarily used for creating boats and other water craft.","permalink":"/Pilot.lua-Luau-LSP/objects/Hull"},{"id":"objects/Hydrogen","title":"Hydrogen","description":"A gas commonly found in stars and gas giants.","permalink":"/Pilot.lua-Luau-LSP/objects/Hydrogen"},{"id":"objects/Hydroponic","title":"Hydroponic","description":"Grows grass and wood from water, turning attached water bins into either wood, sticks or grass. Incredibly useful for space bases or bases in areas devoid of life.","permalink":"/Pilot.lua-Luau-LSP/objects/Hydroponic"},{"id":"objects/HyperDrive","title":"HyperDrive","description":"A device used to travel at faster than light speeds to other regions of the universe.","permalink":"/Pilot.lua-Luau-LSP/objects/HyperDrive"},{"id":"objects/HyperspaceRadar","title":"HyperspaceRadar","description":"A device that images areas of hyperspace, allowing one to view hyperspace disturbances and track where HyperDrives have warped.","permalink":"/Pilot.lua-Luau-LSP/objects/HyperspaceRadar"},{"id":"objects/Ice","title":"Ice","description":"A compact natural resource found in tundra planets and the top of a few mountains. It is a slippery material, and has very low friction which can be useful in some devices.","permalink":"/Pilot.lua-Luau-LSP/objects/Ice"},{"id":"objects/Igniter","title":"Igniter","description":"Sets alight unlocked parts within the immediate vicinity when triggered. Range depends on the size.","permalink":"/Pilot.lua-Luau-LSP/objects/Igniter"},{"id":"objects/ImpactPlate","title":"ImpactPlate","description":"EXPERIMENTAL - Distributes the damage it takes between itself and parts attached to its top surface, with higher health parts absorbing the most damage.","permalink":"/Pilot.lua-Luau-LSP/objects/ImpactPlate"},{"id":"objects/ImpulseCannon","title":"ImpulseCannon","description":"Blasts a harmless burst of energy which sends anything nearby soaring at a high velocity.","permalink":"/Pilot.lua-Luau-LSP/objects/ImpulseCannon"},{"id":"objects/Instrument","title":"Instrument","description":"A part that measures information about the world.","permalink":"/Pilot.lua-Luau-LSP/objects/Instrument"},{"id":"objects/Insulation","title":"Insulation","description":"A flammable material with a low thermal conductivity.","permalink":"/Pilot.lua-Luau-LSP/objects/Insulation"},{"id":"objects/IonRocket","title":"IonRocket","description":"A simple, fast propulsion device which consumes power to produce thrust. Moves in the direction of the arrow.","permalink":"/Pilot.lua-Luau-LSP/objects/IonRocket"},{"id":"objects/Iron","title":"Iron","description":"A compact and durable material, commonly found in planets. It is used often in crafting, and is a very important resource to have. Has poor thermal conductivity compared to most metals.","permalink":"/Pilot.lua-Luau-LSP/objects/Iron"},{"id":"objects/Jade","title":"Jade","description":"Reduces damage taken by 1.5 to a minimum of 0.2, but takes 25% additional damage.","permalink":"/Pilot.lua-Luau-LSP/objects/Jade"},{"id":"objects/Katana","title":"Katana","description":"A weeaboo sword used to cut down your enemies.","permalink":"/Pilot.lua-Luau-LSP/objects/Katana"},{"id":"objects/Keyboard","title":"Keyboard","description":"Similar to a button, except is programmable to take more than one key input.","permalink":"/Pilot.lua-Luau-LSP/objects/Keyboard"},{"id":"objects/Kiln","title":"Kiln","description":"Turns attached sand bins into glass.","permalink":"/Pilot.lua-Luau-LSP/objects/Kiln"},{"id":"objects/Lantern","title":"Lantern","description":"A handheld lantern which can be used to provide light.","permalink":"/Pilot.lua-Luau-LSP/objects/Lantern"},{"id":"objects/Laser","title":"Laser","description":"Fires a concentraded beam of energy when powered, which can be used to damage and set objects on fire.","permalink":"/Pilot.lua-Luau-LSP/objects/Laser"},{"id":"objects/Lava","title":"Lava","description":"A liquid used for fueling many devices such as rockets and engines.","permalink":"/Pilot.lua-Luau-LSP/objects/Lava"},{"id":"objects/Lead","title":"Lead","description":"An uncommon material used in protection against radiation and weapon manufacturing. Has one of the lowest thermal conductivities of all elemental metals in the game, next to Titanium.","permalink":"/Pilot.lua-Luau-LSP/objects/Lead"},{"id":"objects/LifeSensor","title":"LifeSensor","description":"Senses and detects organic life up to a distance of 2000 studs. It only has a purpose within programming.","permalink":"/Pilot.lua-Luau-LSP/objects/LifeSensor"},{"id":"objects/Light","title":"Light","description":"Emits light when powered with electricity. Can be colored in different ways, changing the light color.","permalink":"/Pilot.lua-Luau-LSP/objects/Light"},{"id":"objects/LightBridge","title":"LightBridge","description":"Fires a beam of solid light that can be walked on.","permalink":"/Pilot.lua-Luau-LSP/objects/LightBridge"},{"id":"objects/LightTube","title":"LightTube","description":"Emits light when powered with electricity. Can be colored in different ways, changing the light color.","permalink":"/Pilot.lua-Luau-LSP/objects/LightTube"},{"id":"objects/Magnesium","title":"Magnesium","description":"A shiny gray solid that is flammable, randomly ignites when touching stone.","permalink":"/Pilot.lua-Luau-LSP/objects/Magnesium"},{"id":"objects/Marble","title":"Marble","description":"A compact, durable material. Primarily decorative.","permalink":"/Pilot.lua-Luau-LSP/objects/Marble"},{"id":"objects/Melter","title":"Melter","description":"Melts Ice into liquid Water by consuming Power.","permalink":"/Pilot.lua-Luau-LSP/objects/Melter"},{"id":"objects/Microcontroller","title":"Microcontroller","description":"Runs limited Roblox luau code in an environment called \\"pilot.lua\\".","permalink":"/Pilot.lua-Luau-LSP/objects/Microcontroller"},{"id":"objects/Microphone","title":"Microphone","description":"Used in programming. Takes user\'s input from chat.","permalink":"/Pilot.lua-Luau-LSP/objects/Microphone"},{"id":"objects/MiningLaser","title":"MiningLaser","description":"Fires a beam at resource deposits that will mine them just like an Extractor can, allowing for mining while mobile.","permalink":"/Pilot.lua-Luau-LSP/objects/MiningLaser"},{"id":"objects/Modem","title":"Modem","description":"A part that allows you to send messages cross-region and make HTTP requests to the web.","permalink":"/Pilot.lua-Luau-LSP/objects/Modem"},{"id":"objects/MonsterMashPotion","title":"MonsterMashPotion","description":"You\'ll be a graveyard smash with this thrilling dance potion.","permalink":"/Pilot.lua-Luau-LSP/objects/MonsterMashPotion"},{"id":"objects/Motor","title":"Motor","description":"Spins objects attached to the hinge at the front when powered.","permalink":"/Pilot.lua-Luau-LSP/objects/Motor"},{"id":"objects/MustardGas","title":"MustardGas","description":"A heavy chemical warfare weapon used to damage organisms. Gas Masks nullify the effects of this gas.","permalink":"/Pilot.lua-Luau-LSP/objects/MustardGas"},{"id":"objects/Neon","title":"Neon","description":"A building decoration material that glows by itself without requiring power.","permalink":"/Pilot.lua-Luau-LSP/objects/Neon"},{"id":"objects/Neutronium","title":"Neutronium","description":"The most durable obtainable material in the game. It is a strange form of matter found from the crusts of neutron stars. Due to the nature of neutron stars, neutronium is the hardest known material as well as the densest known material in the universe.","permalink":"/Pilot.lua-Luau-LSP/objects/Neutronium"},{"id":"objects/NightVisionGoggles","title":"NightVisionGoggles","description":"A set of goggles which can be used to see in the dark.","permalink":"/Pilot.lua-Luau-LSP/objects/NightVisionGoggles"},{"id":"objects/NitrogenOxide","title":"NitrogenOxide","description":"A light gas emitted from machines such as extractors and rockets. Inhaling can cause severe lung damage.","permalink":"/Pilot.lua-Luau-LSP/objects/NitrogenOxide"},{"id":"objects/NuclearWaste","title":"NuclearWaste","description":"A highly radioactive material produced from spent Uranium in a reactor.","permalink":"/Pilot.lua-Luau-LSP/objects/NuclearWaste"},{"id":"objects/Obamium","title":"Obamium","description":"An ancient artifact left behind from an alternate reality.","permalink":"/Pilot.lua-Luau-LSP/objects/Obamium"},{"id":"objects/Obelisk","title":"Obelisk","description":"An object designed to attract aliens to the region. Emits an ominous noise when powered.","permalink":"/Pilot.lua-Luau-LSP/objects/Obelisk"},{"id":"objects/ObjectDetector","title":"ObjectDetector","description":"Casts a ray on the face with the hole on it, returning data of the object the ray hits.","permalink":"/Pilot.lua-Luau-LSP/objects/ObjectDetector"},{"id":"objects/Oil","title":"Oil","description":"A liquid used in refineries to produce Gasoline which can be used for fueling engines and rockets and Petroleum which can be used to make plastic.","permalink":"/Pilot.lua-Luau-LSP/objects/Oil"},{"id":"objects/PDW-X44","title":"PDW-X44","description":"A versatile automatic pulse based PDW capable of dishing incredible amounts of damage in a small amount of time. Equipped with 3 barrels for an unparalleled firerate.","permalink":"/Pilot.lua-Luau-LSP/objects/PDW-X44"},{"id":"objects/Perfectium","title":"Perfectium","description":"The perfect material. Unbreakable, very stretchable, but is impossibly rare. The very sight of it makes you wonder the imperfections of human beings.","permalink":"/Pilot.lua-Luau-LSP/objects/Perfectium"},{"id":"objects/Petroleum","title":"Petroleum","description":"A gas used for creating plastic.","permalink":"/Pilot.lua-Luau-LSP/objects/Petroleum"},{"id":"objects/Pipe","title":"Pipe","description":"Provides a medium for the transfer of liquids and gases between Tanks and other objects.","permalink":"/Pilot.lua-Luau-LSP/objects/Pipe"},{"id":"objects/Pistol","title":"Pistol","description":"A simple repeating firearm.","permalink":"/Pilot.lua-Luau-LSP/objects/Pistol"},{"id":"objects/Piston","title":"Piston","description":"More accurately a linear actuator. There is a rail among us.","permalink":"/Pilot.lua-Luau-LSP/objects/Piston"},{"id":"objects/Plasma","title":"Plasma","description":"A gas found abundant in stars, and can be harvested from them. Used primarily for weapons, as well as electrical components.","permalink":"/Pilot.lua-Luau-LSP/objects/Plasma"},{"id":"objects/PlasmaCannon","title":"PlasmaCannon","description":"Fires an orb of unstable plasma out of the barrel exploding on impact.","permalink":"/Pilot.lua-Luau-LSP/objects/PlasmaCannon"},{"id":"objects/Plastic","title":"Plastic","description":"A cheap material made from petroleum and Coal through polymerisation inside assemblers.","permalink":"/Pilot.lua-Luau-LSP/objects/Plastic"},{"id":"objects/Plutonium","title":"Plutonium","description":"A highly radioactive compound used in manufacturing nuclear explosives.","permalink":"/Pilot.lua-Luau-LSP/objects/Plutonium"},{"id":"objects/PlutoniumCore","title":"PlutoniumCore","description":"A volatile core close to going supercritical used in recipes for Nuclear explosives.","permalink":"/Pilot.lua-Luau-LSP/objects/PlutoniumCore"},{"id":"objects/Polysilicon","title":"Polysilicon","description":"An electronic material which transforms a trigger signal into special on/off/toggle signals.","permalink":"/Pilot.lua-Luau-LSP/objects/Polysilicon"},{"id":"objects/Port","title":"Port","description":"Only used in programming. Allows a Microcontroller to interface with PilotObjects.","permalink":"/Pilot.lua-Luau-LSP/objects/Port"},{"id":"objects/PowerCell","title":"PowerCell","description":"Stores electricity, and is used to power many devices using wires or by directly attaching it.","permalink":"/Pilot.lua-Luau-LSP/objects/PowerCell"},{"id":"objects/Primer","title":"Primer","description":"A component used in crafting recipes for a few objects.","permalink":"/Pilot.lua-Luau-LSP/objects/Primer"},{"id":"objects/Propeller","title":"Propeller","description":"Propellers propel forward when spun.","permalink":"/Pilot.lua-Luau-LSP/objects/Propeller"},{"id":"objects/Prosthetic","title":"Prosthetic","description":"An artificial part that can be attached to players in exchange for a limb.","permalink":"/Pilot.lua-Luau-LSP/objects/Prosthetic"},{"id":"objects/ProximityButton","title":"ProximityButton","description":"Sends trigger signals when interacted via its ProximityPrompt.","permalink":"/Pilot.lua-Luau-LSP/objects/ProximityButton"},{"id":"objects/Pulverizer","title":"Pulverizer","description":"Pulverizes resources into powdered forms. Power cost: 3/s.","permalink":"/Pilot.lua-Luau-LSP/objects/Pulverizer"},{"id":"objects/Pump","title":"Pump","description":"Pumps liquid from the environment into attached Tanks. For example, a pump located in the ocean will pump water when powered.","permalink":"/Pilot.lua-Luau-LSP/objects/Pump"},{"id":"objects/Quartz","title":"Quartz","description":"A translucent and malleable crystal useful for making durable windows.","permalink":"/Pilot.lua-Luau-LSP/objects/Quartz"},{"id":"objects/Radar","title":"Radar","description":"An instrument that shows a 2D top-down representation of Earth.","permalink":"/Pilot.lua-Luau-LSP/objects/Radar"},{"id":"objects/Radiator","title":"Radiator","description":"LEGACY. Emits heat by releasing photons, making it ideal for discarding heat, and cooling things down. Will raise the temperature of surrounding air by 2.25 \xb0F/s (85% of the input heat will be permanently discarded). Effectively gets rid of 16.6 kW (1 kW is 1 kJ/s) of heat energy. In total, only 2.93 kW of the heat energy it releases will re-enter any surrounding air. In space, all 19.53 kW of the Radiator\'s throughput will be expelled.","permalink":"/Pilot.lua-Luau-LSP/objects/Radiator"},{"id":"objects/Rail","title":"Rail","description":"Slides and moves objects along its surface when powered and triggered.","permalink":"/Pilot.lua-Luau-LSP/objects/Rail"},{"id":"objects/Railgun","title":"Railgun","description":"Fires a piercing Rail at high speeds. A long range weapon. Requires Rails and electricity for ammo. The damage increases for every 10 studs of length.","permalink":"/Pilot.lua-Luau-LSP/objects/Railgun"},{"id":"objects/Reactor","title":"Reactor","description":"Generates steam using water and heat from radiation.","permalink":"/Pilot.lua-Luau-LSP/objects/Reactor"},{"id":"objects/Refinery","title":"Refinery","description":"Turns oil into Petroleum and Gasoline.","permalink":"/Pilot.lua-Luau-LSP/objects/Refinery"},{"id":"objects/RegionCloaker","title":"RegionCloaker","description":"Hides a certain region from players, making the coordinates not appear on their screen.","permalink":"/Pilot.lua-Luau-LSP/objects/RegionCloaker"},{"id":"objects/ReinforcedGlass","title":"ReinforcedGlass","description":"A stronger, slightly less malleable version of glass. Blocks radiation.","permalink":"/Pilot.lua-Luau-LSP/objects/ReinforcedGlass"},{"id":"objects/Relay","title":"Relay","description":"A powerful transmitter capable of transmitting trigger signals and resources/power between different regions.","permalink":"/Pilot.lua-Luau-LSP/objects/Relay"},{"id":"objects/RemoteControl","title":"RemoteControl","description":"Sends trigger signals forward wirelessly when triggered. Supports all variants of trigger signals including from Polysilicon.","permalink":"/Pilot.lua-Luau-LSP/objects/RemoteControl"},{"id":"objects/RepairKit","title":"RepairKit","description":"A useful kit of tools that can be used to repair objects which have been damaged. Keep away from biters.","permalink":"/Pilot.lua-Luau-LSP/objects/RepairKit"},{"id":"objects/RepairLaser","title":"RepairLaser","description":"Fires a beam that repairs objects. Repairs 1 HP/s.","permalink":"/Pilot.lua-Luau-LSP/objects/RepairLaser"},{"id":"objects/RepairPlate","title":"RepairPlate","description":"EXPERIMENTAL - While at least 90% charged (27 power), distributes repaired health between itself and damaged parts attached to its top surface.","permalink":"/Pilot.lua-Luau-LSP/objects/RepairPlate"},{"id":"objects/Rice","title":"Rice","description":"Rice is nice.","permalink":"/Pilot.lua-Luau-LSP/objects/Rice"},{"id":"objects/Rifle","title":"Rifle","description":"A powerful long-range bolt action weapon. Q to scope.","permalink":"/Pilot.lua-Luau-LSP/objects/Rifle"},{"id":"objects/Rocket","title":"Rocket","description":"A propulsion device that consumes gasoline.","permalink":"/Pilot.lua-Luau-LSP/objects/Rocket"},{"id":"objects/Rotor","title":"Rotor","description":"Provides vertical height when spun, and only works in oxygen planets.","permalink":"/Pilot.lua-Luau-LSP/objects/Rotor"},{"id":"objects/RoundWedge","title":"RoundWedge","description":"A block rounded on one edge, or 1/4 of a cylinder.","permalink":"/Pilot.lua-Luau-LSP/objects/RoundWedge"},{"id":"objects/RoundWedge2","title":"RoundWedge2","description":"A block rounded inwards on one edge.","permalink":"/Pilot.lua-Luau-LSP/objects/RoundWedge2"},{"id":"objects/Router","title":"Router","description":"A wireless transmitter that can transmit an ethernet connection.","permalink":"/Pilot.lua-Luau-LSP/objects/Router"},{"id":"objects/RTG","title":"RTG","description":"Creates electricity from decaying radioactive elements.","permalink":"/Pilot.lua-Luau-LSP/objects/RTG"},{"id":"objects/Rubber","title":"Rubber","description":"A textile resource used in manufacturing many industrial objects.","permalink":"/Pilot.lua-Luau-LSP/objects/Rubber"},{"id":"objects/Ruby","title":"Ruby","description":"A shiny red gem which can be found in mountain deposits. Exceptionally durable for how easily it can be obtained. Takes 2x energy damage & allows lasers to pass.","permalink":"/Pilot.lua-Luau-LSP/objects/Ruby"},{"id":"objects/RustedMetal","title":"RustedMetal","description":"A weathered piece of metal.","permalink":"/Pilot.lua-Luau-LSP/objects/RustedMetal"},{"id":"objects/Sail","title":"Sail","description":"Utilizes the wind to move forward.","permalink":"/Pilot.lua-Luau-LSP/objects/Sail"},{"id":"objects/Sand","title":"Sand","description":"An abundant resource that can be found in the shores of terra and forest planets, the sea floors of ocean planets and in the dunes of desert planets. When burnt, the sand becomes glass.","permalink":"/Pilot.lua-Luau-LSP/objects/Sand"},{"id":"objects/Scanner","title":"Scanner","description":"An end-game part which can remotely retrieve Microcontroller references to parts, providing information and control. Can also triangulate the positions of enemy parts given enough well placed scanners.","permalink":"/Pilot.lua-Luau-LSP/objects/Scanner"},{"id":"objects/Scrapper","title":"Scrapper","description":"Scraps unlocked solid items into their crafting components (with some loss) on contact when powered, else destroys them if unpowered. Will send locked single raw parts such as Iron or AlienCore into connected bins.","permalink":"/Pilot.lua-Luau-LSP/objects/Scrapper"},{"id":"objects/Screen","title":"Screen","description":"Allows for the programmatic creation of GUI elements.","permalink":"/Pilot.lua-Luau-LSP/objects/Screen"},{"id":"objects/ScubaMask","title":"ScubaMask","description":"A set of goggles which can be used to help vision while underwater.","permalink":"/Pilot.lua-Luau-LSP/objects/ScubaMask"},{"id":"objects/Seat","title":"Seat","description":"It is a craftable and spawnable non-flammable solid.","permalink":"/Pilot.lua-Luau-LSP/objects/Seat"},{"id":"objects/Servo","title":"Servo","description":"Spins objects attached to the hinge at the front when powered, to set angles.","permalink":"/Pilot.lua-Luau-LSP/objects/Servo"},{"id":"objects/Shotgun","title":"Shotgun","description":"Fires a shot of harmful pellets when triggered.","permalink":"/Pilot.lua-Luau-LSP/objects/Shotgun"},{"id":"objects/Sign","title":"Sign","description":"Displays text or images. To display an image, configure it to id:imageid.","permalink":"/Pilot.lua-Luau-LSP/objects/Sign"},{"id":"objects/Silicon","title":"Silicon","description":"A metalloid that is very useful for electronics. Can commonly be found in cliffs and rocks.","permalink":"/Pilot.lua-Luau-LSP/objects/Silicon"},{"id":"objects/SMG","title":"SMG","description":"A fast firing, fully automatic gun able to pump out lots of rounds down range.","permalink":"/Pilot.lua-Luau-LSP/objects/SMG"},{"id":"objects/SmoothGlass","title":"SmoothGlass","description":"A version of Glass using the Roblox Glass material. Additionally can be templated.","permalink":"/Pilot.lua-Luau-LSP/objects/SmoothGlass"},{"id":"objects/SmoothReinforcedGlass","title":"SmoothReinforcedGlass","description":"A version of ReinforcedGlass using the Roblox Glass material.","permalink":"/Pilot.lua-Luau-LSP/objects/SmoothReinforcedGlass"},{"id":"objects/Snow","title":"Snow","description":"An abundant resource that can be found in terra biomes and tundra planets. Can be melted into water.","permalink":"/Pilot.lua-Luau-LSP/objects/Snow"},{"id":"objects/SolarPanel","title":"SolarPanel","description":"Generates electricity using solar energy from a local star.","permalink":"/Pilot.lua-Luau-LSP/objects/SolarPanel"},{"id":"objects/Solenoid","title":"Solenoid","description":"Controls the switch state of any switches attached to its output face based on whether or not it has power in the configured range.","permalink":"/Pilot.lua-Luau-LSP/objects/Solenoid"},{"id":"objects/Sorter","title":"Sorter","description":"Moves a type of resource through it, depending on the input and output faces as indicated by the arrow. Behaves just like the old Diode part when set to insert 100 Power.","permalink":"/Pilot.lua-Luau-LSP/objects/Sorter"},{"id":"objects/SoundMuffler","title":"SoundMuffler","description":"A SoundMuffler will silences the sounds of machinery around it.","permalink":"/Pilot.lua-Luau-LSP/objects/SoundMuffler"},{"id":"objects/SpawnPoint","title":"SpawnPoint","description":"Acts as a spawn location for the player who locked it.","permalink":"/Pilot.lua-Luau-LSP/objects/SpawnPoint"},{"id":"objects/Speaker","title":"Speaker","description":"Plays audio of length up to 5 seconds, unless it is powered in which case it can play a full audio.","permalink":"/Pilot.lua-Luau-LSP/objects/Speaker"},{"id":"objects/Spheroid","title":"Spheroid","description":"A stretchable sphere shaped template object.","permalink":"/Pilot.lua-Luau-LSP/objects/Spheroid"},{"id":"objects/Spotlight","title":"Spotlight","description":"Emits light in a cone when powered with electricity. Color emition can be changed by coloring it.","permalink":"/Pilot.lua-Luau-LSP/objects/Spotlight"},{"id":"objects/Stanlium","title":"Stanlium","description":"Its love quivers, like it yearns for something within you; an eerie siren song that penetrates souls and tells of the destruction.","permalink":"/Pilot.lua-Luau-LSP/objects/Stanlium"},{"id":"objects/StarMap","title":"StarMap","description":"Shows your current location in the universe and other nearby stars and celestial bodies.","permalink":"/Pilot.lua-Luau-LSP/objects/StarMap"},{"id":"objects/StasisField","title":"StasisField","description":"Creates a 500 stud radius field that prevents any parts or objects around it from being dragged.","permalink":"/Pilot.lua-Luau-LSP/objects/StasisField"},{"id":"objects/Steam","title":"Steam","description":"A result of water being heated up to high temperatures.","permalink":"/Pilot.lua-Luau-LSP/objects/Steam"},{"id":"objects/SteamEngine","title":"SteamEngine","description":"It acts similar to a motor, but is powered by Steam instead of electricity.","permalink":"/Pilot.lua-Luau-LSP/objects/SteamEngine"},{"id":"objects/SteamTurbine","title":"SteamTurbine","description":"Produces power from steam at a base rate of 100 power each. Improves up to 250 per steam if consecutively ran at max speed. All bonuses are capped to the real consumption rate, so more steam equals better efficiency, but faster consumption rates. It may consume +0.5/s^2 steam, up to a maximum rate of 10 steam per second (for a total of 2500 power per second). Has a 10% chance to recover water for every steam consumed, improving up to 20%. Maximum efficiency can be reached in no less than 18 seconds if fed an optimal amount of steam.","permalink":"/Pilot.lua-Luau-LSP/objects/SteamTurbine"},{"id":"objects/Stick","title":"Stick","description":"A natural resource found in trees and flora, often accompanied by wood. It is used for creating vital tools.","permalink":"/Pilot.lua-Luau-LSP/objects/Stick"},{"id":"objects/Stone","title":"Stone","description":"A resource found in nearly all planets. It is not recommended to use for structures, but is often used in crafting simple objects.","permalink":"/Pilot.lua-Luau-LSP/objects/Stone"},{"id":"objects/StorageSensor","title":"StorageSensor","description":"When the number of contents within connected storage objects is within a defined range, it will send trigger signals similar to a button.","permalink":"/Pilot.lua-Luau-LSP/objects/StorageSensor"},{"id":"objects/StudAligner","title":"StudAligner","description":"Snaps the entire assembly its attached to to the grid.","permalink":"/Pilot.lua-Luau-LSP/objects/StudAligner"},{"id":"objects/Sulfur","title":"Sulfur","description":"A yellow flammable solid which can be found in Stone deposits. Being set on fire gives it a special blue fire.","permalink":"/Pilot.lua-Luau-LSP/objects/Sulfur"},{"id":"objects/Switch","title":"Switch","description":"Acts as a wire when active/green, but when black or inactive it acts as a normal object. Must use a polysilicon to switch for trigger events.","permalink":"/Pilot.lua-Luau-LSP/objects/Switch"},{"id":"objects/Tank","title":"Tank","description":"Stores liquids and gases. When a liquid or gas touches the Tank, the Tank will automatically store it. Will not conduct heat when containing a fluid, making it a good heat storage part.","permalink":"/Pilot.lua-Luau-LSP/objects/Tank"},{"id":"objects/Teleporter","title":"Teleporter","description":"A device used to transport players across regions.","permalink":"/Pilot.lua-Luau-LSP/objects/Teleporter"},{"id":"objects/Telescope","title":"Telescope","description":"A device that allows you to see and query information about other regions and planets in space while powered.","permalink":"/Pilot.lua-Luau-LSP/objects/Telescope"},{"id":"objects/TemperatureGate","title":"TemperatureGate","description":"The gate will allow power to pass through it while the temperature is in a certain range.","permalink":"/Pilot.lua-Luau-LSP/objects/TemperatureGate"},{"id":"objects/TemperatureSensor","title":"TemperatureSensor","description":"When the surrounding temperature is within the defined range, it will emit a trigger signal every two seconds.","permalink":"/Pilot.lua-Luau-LSP/objects/TemperatureSensor"},{"id":"objects/TestStarMap","title":"TestStarMap","description":"A developer version of the starmap.","permalink":"/Pilot.lua-Luau-LSP/objects/TestStarMap"},{"id":"objects/Tetrahedron","title":"Tetrahedron","description":"A tetrahedron template made of 3 perpendicular right triangles.","permalink":"/Pilot.lua-Luau-LSP/objects/Tetrahedron"},{"id":"objects/Thruster","title":"Thruster","description":"A high powered propulsion device. The larger the thruster, the faster it can go, up to 500s/s, but it will consume more power.","permalink":"/Pilot.lua-Luau-LSP/objects/Thruster"},{"id":"objects/Tile","title":"Tile","description":"A cheap material made from baked clay useful for building houses.","permalink":"/Pilot.lua-Luau-LSP/objects/Tile"},{"id":"objects/TimeSensor","title":"TimeSensor","description":"When the current time matches the time configured in the TimeSensor, it will send a trigger signal.","permalink":"/Pilot.lua-Luau-LSP/objects/TimeSensor"},{"id":"objects/tinnitus","title":"tinnitus","description":"An interesting spring which does strange things.","permalink":"/Pilot.lua-Luau-LSP/objects/tinnitus"},{"id":"objects/TintedGlass","title":"TintedGlass","description":"A material similar to Glass, but is tinted black on the front..","permalink":"/Pilot.lua-Luau-LSP/objects/TintedGlass"},{"id":"objects/Tire","title":"Tire","description":"A cylindrical shaped object used commonly in vehicles such as cars.","permalink":"/Pilot.lua-Luau-LSP/objects/Tire"},{"id":"objects/Titanium","title":"Titanium","description":"A strong heavy material that is very useful for small scale constructs. Has a very low thermal conductivity, the lowest of all metals in the game.","permalink":"/Pilot.lua-Luau-LSP/objects/Titanium"},{"id":"objects/Torch","title":"Torch","description":"A torch which can be used to provide light.","permalink":"/Pilot.lua-Luau-LSP/objects/Torch"},{"id":"objects/TouchScreen","title":"TouchScreen","description":"A Screen, but can handle player mouse input.","permalink":"/Pilot.lua-Luau-LSP/objects/TouchScreen"},{"id":"objects/TouchSensor","title":"TouchSensor","description":"Sends trigger signals upon contact.. with anything.","permalink":"/Pilot.lua-Luau-LSP/objects/TouchSensor"},{"id":"objects/TractorBeam","title":"TractorBeam","description":"Fires a beam that exerts force on the object it hits. More effective in space due to low gravity, but still decently strong when affected by gravity. Force is affected by size and configuration.","permalink":"/Pilot.lua-Luau-LSP/objects/TractorBeam"},{"id":"objects/Transformer","title":"Transformer","description":"Sends a constant trigger signal when powered. By default, it will send a trigger signal every tick, but can be configured up to every 360 seconds. If the transformer\'s loop time matches the game\'s internal tick rate (the default,  1/s), it will synchronize with the game loop.","permalink":"/Pilot.lua-Luau-LSP/objects/Transformer"},{"id":"objects/Transistor","title":"Transistor","description":"Carries trigger signals in the direction of the arrow if any power source is attached. Can be inverted by clicking or configuring.","permalink":"/Pilot.lua-Luau-LSP/objects/Transistor"},{"id":"objects/Transporter","title":"Transporter","description":"Acts as an antenna but for bins and objects containing materials such as liquids and solids.","permalink":"/Pilot.lua-Luau-LSP/objects/Transporter"},{"id":"objects/Treads","title":"Treads","description":"Moves against surfaces it contacts. In order for the treads to function, you need to use a Motor, Engine, or DriveBox to spin up a part which will act as the driver part. The driver part should be connected to the treads via a rod, and should spin with the same orientation as a wheel would to achieve maximum speed.","permalink":"/Pilot.lua-Luau-LSP/objects/Treads"},{"id":"objects/TriggerRelay","title":"TriggerRelay","description":"Acts as a TriggerWrite when active/green, but when black or inactive it acts as a normal object, it will not toggle when exposed to Polysilicon signals, rather, it will pass them through if it is active, as if it were a normal signal.","permalink":"/Pilot.lua-Luau-LSP/objects/TriggerRelay"},{"id":"objects/TriggerSwitch","title":"TriggerSwitch","description":"Acts as a TriggerWrite when active/green, but when black or inactive it acts as a normal object. It will toggle when exposed to Polysilicon signals.","permalink":"/Pilot.lua-Luau-LSP/objects/TriggerSwitch"},{"id":"objects/TriggerWire","title":"TriggerWire","description":"Allows trigger objects to interact with each other when connected by triggerwires.","permalink":"/Pilot.lua-Luau-LSP/objects/TriggerWire"},{"id":"objects/Truss","title":"Truss","description":"Used as a ladder.","permalink":"/Pilot.lua-Luau-LSP/objects/Truss"},{"id":"objects/Turbofan","title":"Turbofan","description":"Generates thrust from crude Oil, similar to a Thruster.","permalink":"/Pilot.lua-Luau-LSP/objects/Turbofan"},{"id":"objects/Uranium","title":"Uranium","description":"A radioactive material often found in deposits in planets, especially ones near stars.","permalink":"/Pilot.lua-Luau-LSP/objects/Uranium"},{"id":"objects/Valve","title":"Valve","description":"Acts as a pipe when active/gray, but when black or inactive it acts as a normal object.","permalink":"/Pilot.lua-Luau-LSP/objects/Valve"},{"id":"objects/VehicleSeat","title":"VehicleSeat","description":"Allows players to control vehicles by rotating when sat on.","permalink":"/Pilot.lua-Luau-LSP/objects/VehicleSeat"},{"id":"objects/VintagePlasmaPistol","title":"VintagePlasmaPistol","description":"They don\'t make em like they used to.","permalink":"/Pilot.lua-Luau-LSP/objects/VintagePlasmaPistol"},{"id":"objects/VitalScanner","title":"VitalScanner","description":"Displays chemicals another player has absorbed.","permalink":"/Pilot.lua-Luau-LSP/objects/VitalScanner"},{"id":"objects/Water","title":"Water","description":"The basis of all life, and is a liquid found in terra, forest, ocean and certain tundras and rogue planets.","permalink":"/Pilot.lua-Luau-LSP/objects/Water"},{"id":"objects/WaterCooler","title":"WaterCooler","description":"Removes -100 heat from the surrounding area, when supplied with power. Performs the same amount of cooling that five coolers would, give or take.","permalink":"/Pilot.lua-Luau-LSP/objects/WaterCooler"},{"id":"objects/Wedge","title":"Wedge","description":"A triangular shaped template object.","permalink":"/Pilot.lua-Luau-LSP/objects/Wedge"},{"id":"objects/Winch","title":"Winch","description":"A special device used to control the length of constraints attached to it.","permalink":"/Pilot.lua-Luau-LSP/objects/Winch"},{"id":"objects/WindTurbine","title":"WindTurbine","description":"Creates rotation using the wind.","permalink":"/Pilot.lua-Luau-LSP/objects/WindTurbine"},{"id":"objects/Wing","title":"Wing","description":"Creates lift from being pushed forward.","permalink":"/Pilot.lua-Luau-LSP/objects/Wing"},{"id":"objects/Wire","title":"Wire","description":"Allows electrical objects to interact with each other when connected by wires. For example, attaching a wire between a powercell and a light will allow electricity to move through the wire, allowing the light to function causing a source of light to be created.","permalink":"/Pilot.lua-Luau-LSP/objects/Wire"},{"id":"objects/WirelessButton","title":"WirelessButton","description":"Similar to a button, but can be clicked from infinite distances and cannot be used for keybinds.","permalink":"/Pilot.lua-Luau-LSP/objects/WirelessButton"},{"id":"objects/Wood","title":"Wood","description":"A natural resource found in trees and flora. It is a simple and yet effective material that is used for simple objects and structures. These can be mainly found in terra and forest planets, but can occasionally be found in temperate tundra and desert planets.","permalink":"/Pilot.lua-Luau-LSP/objects/Wood"},{"id":"objects/ZapWire","title":"ZapWire","description":"Electrocutes players when touched. Can be used to set flammable objects on fire.","permalink":"/Pilot.lua-Luau-LSP/objects/ZapWire"}],"unlisted":false}}')}}]);